'#LoveisLove, for me, means freedom of expression, freedom to love. To be who you want to be, without judgement. It's a dream, wearing Pronovias at your wedding, so great!'

@magalidalix & @claudialeonrodriguez 

As #Pronovias, in our commitment to defend equality, freedom and tolerance, we show our support joining all couples in the world to celebrate diversity and love in all its forms.
